import React from 'react';

function Footer() {
    return(
        <section>
            <p>This site was created by VINCENT 'kaylin' TATE</p>
            <a href= "https://github.com/AdmiralCrunchy" >
                <img alt="GitHub Logo" src= "https://cdn-icons-png.flaticon.com/512/25/25231.png" width="64px" height="64px"/>
            </a>
            <a href= "https://www.linkedin.com/in/vincent-tate-5b5194133/" >
                <img alt="Linkedin Logo" src='https://www.iconpacks.net/icons/1/free-linkedin-icon-112-thumb.png' width='64px' height='64px'/>
            </a>
            <a href='https://gitlab.com/vincentjtate'>
                <img alt="GitLab Logo" src='https://assets.stickpng.com/images/5847f997cef1014c0b5e48c1.png' width='64px' height='64px'/>
            </a>
        </section>
    )
}

export default Footer;
